import { useCallback, useEffect, useState } from "react";
import styled from "styled-components";
import makeRequest from "../utils/fetch-request";
import DataTable from "../utils/table";
import { AdminLayout, SubHeader } from "../components";
import SettingsMenu from "../components/settings/SettingsMenu";

const UsersList = (props: any) => {
  const [userList, setUserList] = useState({});
  const [error, setError] = useState(null);

  const fetchUsers = useCallback(() => {
    let _url = "/users/get";

    makeRequest({ url: _url, method: "get", data: null }).then(
      ([status, result]) => {
        if (status !== 200) {
          setError(result?.message || "Error, could not fetch records");
        } else {
          console.log(result);
          setUserList(result?.data || []);
        }
      }
    );
  }, []);

  useEffect(() => {
    fetchUsers();
    console.log(userList);
  }, [fetchUsers]);
  return (
    <AdminLayout showSideMenu={true} user={props.user}>
      <Home>
        <SubHeader
          pageTitle="Users"
          pageSubTitle="0 Users on Uncover"
          btnTxt="Create new user"
          onPress={() => void null}
          showCreateButton={true}
        />
        <div className="container-fluid">
          <div className="row pe-1">
              <div className="col-lg-2">
                <SettingsMenu />
              </div>
              <div className="col-lg-6">
                  <table>
                      <thead>
                        <tr>
                              <td>Name</td>
                              <td>Email</td>
                              <td>Phone Number</td>
                              <td>User Type</td>
                              <td>Property</td>
                        </tr>
                        </thead>
                        <tbody>
                          <tr>
                            <td>Wanyama</td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                          </tr>
                          <tr>
                            <td>Wanyama</td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                          </tr>
                        </tbody>
                  </table>
              </div>
              <div className="col-lg-4">
                        <Sidebar>
                                <div className="field-wrapper">
                                    <div>
                                            <span>Nairobi</span>
                                    </div>
                                    <div className="btnwrapper">
                                            <button>Edit</button>
                                            <button>Delete</button>
                                    </div>
                                </div>
                                <hr className="firstchild" />
                                <div className="field-wrapper">
                                    <span>Market Name:</span>
                                    <span>Nairobi</span>
                                </div>
                                <hr  />
                                <div className="field-wrapper">
                                    <span>Country:</span>
                                    <span>Kenya</span>
                                </div>
                                <hr />
                                <div className="field-wrapper">
                                    <span>City:</span>
                                    <span >Nairobi</span>
                                </div>

                            </Sidebar>
                            <Sidebar>
                               <div className="field-wrapper">
                                    <div>
                                        <span><strong>User Activities</strong></span>
                                    </div>
                                </div>
                            </Sidebar>
                    </div>
          </div>
        </div>
      </Home>
    </AdminLayout>
  );
};

const Home = styled.div`
  width: 100%;
  height: auto;
  .bg-white {
    background-color: #fff;
    padding: 10px;
  }
  .col-lg-12 {
    width: 100%;
    margin: auto;
    display: flex;
    justify-content: space-between;
    padding: 0;
    .booking-tab {
      flex: 0.2;
      background-color: #fff;
      padding: 30px 20px;
      position: relative;
      p {
        cursor: pointer;
      }
      .fa {
        font-size: 1.1rem;
        padding-right: 20px;
      }
      a {
        text-decoration: none;
        color: #000;
      }
    }
    .booking-details {
      flex: 0.78;
      height: 100%;
      background-color: #f1f1f1;
    }
  }
  .booking-container {
    margin: 20px 0px 100px 0px;
  }

`;

const Sidebar = styled.div`
width:100%;
border:1px solid #f1f1f1;
background-color:#fff;
padding:10px;
margin-bottom:20px;
.field-wrapper{
    display:flex;
    justify-content:space-between;
    align-items:center;
    .btnwrapper button{
        border:none;
        outline:none;
        margin-left:20px;
        padding:3px 7px;
    }
    span{
        font-size:.75rem
    }
    .color{
        background-color:orange;
        padding:3px 7px;
        border-radius:5px;
        text-align:center;
    }
}
hr{
    background-color:#ccc;
}
hr.firstchild{
    background-color:#666
}`

export default UsersList;
